import StartPage from './components/startpage-component';
import React, { Component } from "react";
import { Link } from 'react-router-dom';
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import ContactPage from './components/contact-component';
import AboutMe from './components/aboutme-component';
import Stack from 'react-bootstrap/Stack'


class App extends Component {
  render() {
    return (
      <Router>
        <div>
          <div className="navbar navbar-expand-lg navbar-dark bg-dark">
            <a href="/" className="navbar-brand bg-dark " >
              Elin Nilsson
            </a>

          </div>
          <Stack direction="horizontal" gap={2} style={{ backgroundColor: "white" }}>
            <div className="navbar-nav mr-auto border">
              <li className="nav-item">
                <Link to={"/contact"} className="" className="nav-link bg-light border">
                  Kontakt
                </Link>
              </li>
              <div className="vr" />
              <li className="bg-dark border ms-auto nav-item">
                <Link to={"/aboutme"} className="nav-link bg-light border ms-auto">
                  Om mig
                </Link>
              </li>
            </div>
          </Stack>

          <div className="container mt-3">
            <Routes>
              <Route path="/contact" exact element={<ContactPage />} />
              <Route path="/aboutme" exact element={<AboutMe />} />
              <Route path="/" exact element={< StartPage />} />
            </Routes>
          </div>
        </div>
      </Router>
    );
  }
}


export default App;
